import React from "react";

export default function Sidebar(){
  return (
    <aside className="sidebar">
      <h2>Municipal Dashboard</h2>
      <nav>
        <a href="#">Map</a>
        <a href="#">Complaints</a>
        <a href="#">Analytics</a>
        <a href="#">Staff</a>
        <a href="#">Settings</a>
      </nav>
    </aside>
  );
}
